const Index = () => (
  <div className="index-container">
    <h1>R E N A</h1>
    <h3>It's Just Art</h3>
    <style jsx>{
      `
      * {
        font-family: Roboto;
        box-sizing: border-box;

      }
      html {
        padding: 0
      }
      .index-container {
        display: flex;
        flex-direction: column;
        align-items: center;
        background-color: blue;
        width: 100%;
      }
      `
    }
    </style>
  </div>
)

export default Index
